import React, { Component } from 'react';
import './App.css';


class App extends Component {

  render() {
    const profile = <img src={"jackson.jpeg"} />
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Ticket</h1>
        </header>
        <p className="App-intro">
        {profile}
        </p>
      </div>
    );
  }
}

export default App;
